    e.preventDefault()
    const formData = new FormData(form);
    const seatNum = formData.get('seatNum');

  })
  const [vars, tastStat] = useState([
    {text:'happy',id:1},
    {text:'welcome',id:2},
    {text:'playing',id:3},
    {text:'just go',id:4}
    ])
  return (
    <div className='container'>
      <Tasks vasrs={seatNum}/>
    </div>
  );
}

export default App;
